import React from 'react';
import { Link } from 'react-router-dom'; // React Router for SPA navigation

function Footer() {
    return (
        <footer className="bg-gray-800 text-white p-5 flex justify-between items-center text-center font-sans">
            {/* Logo Section */}
            <div className="flex-1">
                <img src="../assets/logo.png" alt="Crystal Saddler Photography" className="max-w-xs h-auto" />
            </div>

            {/* Navigation Links */}
            <nav className="flex-1">
                <ul className="flex justify-center items-center gap-4">
                    <li><Link to="/" className="text-white text-lg no-underline hover:text-gray-300">Home</Link></li>
                    <li><Link to="/about" className="text-white text-lg no-underline hover:text-gray-300">About</Link></li>
                    <li><Link to="/contact" className="text-white text-lg no-underline hover:text-gray-300">Contact Us</Link></li>
                </ul>
            </nav>

            {/* Email Section */}
            <div className="flex-1 text-right">
                <p className="text-lg">crystalsaddlerphotography@yahoo.com</p>
            </div>
        </footer>
    );
}

export default Footer;
